import ReactPDF, { PDFViewer } from '@react-pdf/renderer'
import React from 'react'
import Pdf from './Pdf'

export const Resume = () => {
  return (
    <div>
    <PDFViewer>
    <Pdf />
  </PDFViewer>
    </div>
  )
}
ReactPDF.renderToStream(<Pdf />);
